import React from 'react';
import './App.css';
import internal from 'stream';

interface MyProps {
};

interface Farm{
  premise_id : number;
  name : string;
  address : string;
  city : string;
  state: string;
  postal_code: number;
  total_population: number;
}

interface MyState {
  status: string;
  data: Farm[];
};

class App extends React.Component<MyProps,MyState>{
  constructor(props : MyProps){
    super(props);
    this.state = {
      status: "Fetching records..",
      data: [{
        premise_id : 0,
        name : '',
        address : '',
        city : '',
        state: '',
        postal_code: 0,
        total_population: 0
      }]
    };
  }

  async componentDidMount() {
    try {
      const res = await fetch('http://localhost:8000/farm/');
      const temp = await res.json()

      this.setState({
        status : temp["status"],
        data: temp["data"]
      });

      console.log(this.state.data)
    } catch (e) {
      console.log(e);
    }
  }

  render(): React.ReactNode {
    return (
      <h1>
        {this.state.data.map((data, key) => {
          return (
          <tr key={key}>
            <td>{data.premise_id}</td>
            <td>{data.id}</td>
            <td>{data.task}</td>
          </tr>
          )
          })}
      </h1>
    )
  }
}

export default App;
